import React from "react";
import "./Landing.scss";

//image imports
import Cullen from "../resources/images/Cullen.jpg";

const Landing = () => {
    return (
        <div className="landing-container">
            <div className="header-container">
                <div className="home-container">Coog Music</div>
                <div className="login-button">
                    <button>Sign In</button>
                </div>
                <div>
                    <button>Create an Account</button>
                </div>
            </div>
            <div className="content-container">
                <h1>
                    A music streaming platform made for the University of
                    Houston.
                </h1>
                <h3>
                    Upload your tracks to share them with thousands of students
                    and alumni.
                </h3>
                <div className="cullen-image-container">
                    <img src={Cullen} />
                </div>
            </div>
            <div className="footer-container"> Â© 2020, Coog Music, Inc. </div>
        </div>
    );
};

export default Landing;
